import React, { Component } from "react";
import { connect } from "react-redux";
class Home extends Component {
  render() {
    return (
      <div>
        <h2>Grub Hub</h2>
      </div>
    );
  }
}

function mapStoreToProps(state) {
  return state;
}
export default connect(mapStoreToProps)(Home);
